import './App.css';
import Registration from './Registration';
import Login from './Login';
import theme from "./theme";
import { ThemeProvider } from '@emotion/react';

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
    <div className="App">
      <Registration/><br></br><br></br>
      <Login/>
    </div>
    </ThemeProvider>
  );
}

export default App;
